import React from 'react';

const ImageView = ({ images, onImageClick }) => {
  return (
    <div className="image-view">
      {images.map(image => (
        <img
          key={image.id}
          src={image.src}
          alt={image.title}
          onClick={() => onImageClick(image)}
        />
      ))}
    </div>
  );
};

export default ImageView;
